import React from 'react';
import './App.css';
import Pokecard from '../components/Pokecard/Pokecard';

function App() {
  return (
    <div className="App">
     <Pokecard id="001"/>
     <Pokecard id="002"/>
     <Pokecard id="003"/>
     <Pokecard id="004"/>
     <Pokecard id="005"/>
     <Pokecard id="006"/>
     <Pokecard id="008"/>
     <Pokecard id="009"/>
     <Pokecard id="010"/>
     <Pokecard id="011"/>
    </div>
  );
}

export default App;
